'use strict';(function(){const indexCfg={cache:true};indexCfg.doc={id:'id',field:['title','content'],store:['title','href'],};const index=FlexSearch.create('balance',indexCfg);window.bookSearchIndex=index;index.add({'id':0,'href':'/AFLplusplus-website/','title':"AFLplusplus",'content':""});index.add({'id':1,'href':'/AFLplusplus-website/categories/','title':"Categories",'content':""});index.add({'id':2,'href':'/AFLplusplus-website/tags/','title':"Tags",'content':""});index.add({'id':3,'href':'/AFLplusplus-website/','title':"The AFL++ fuzzing framework",'content':"AFL++ Overview The AFL++ fuzzing framework includes the following:\n A fuzzer with many mutators and configurations: afl-fuzz. Different source code instrumentation modules: LLVM mode, afl-as, GCC plugin. Different binary code instrumentation modules: QEMU mode, Unicorn mode, QBDI mode. Utilities for testcase/corpus minimization: afl-tmin, afl-cmin. Helper libraries: libtokencap, libdislocator, libcompcov.  What is AFL++ AFLplusplus is the son of the American Fuzzy Lop fuzzer and was created initially to incorporate all the best features developed in the years for the fuzzers in the AFL family and not merged in AFL cause it is not updated since November 2017.\n"});})();